// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// Import the PricingLibrary contract
import "./PlayerPricing.sol";

// Main contract using the library
contract FootiuMM {

    struct NFT {
        uint256 rating;
        bool locked;
    }

    mapping(address => NFT) public lockedNFTs;
    mapping(address => uint256) public points;


    PlayerPricing public pricingLibrary;

    constructor(address _pricingLibrary) {
        pricingLibrary = PlayerPricing(_pricingLibrary);
    }

    // Function to get the price using the library contract
    function getPrice(uint256 input) public view returns (uint256) {
        return pricingLibrary.calculatePrice(input);
    }

        // Function to lock up an NFT and attribute points based on its rating
    function lockUpNFT(address _nftOwner, uint256 _rating) external {
        require(!lockedNFTs[_nftOwner].locked, "NFT already locked");
        
        // Assume rating is provided correctly
        NFT memory newNFT = NFT(_rating, true);
        lockedNFTs[_nftOwner] = newNFT;

        // Attribute points based on rating
        points[msg.sender] += _rating;
    }
}

